//Reference used https://www.pluralsight.com/guides/creating-dynamic-editable-tables-with-reactjs
import React from "react";
import "App.css";

const App = () => {
    return (
        <div className="app-container">
            <table>
                <thread>
                    <tr>
                        <th>Date</th>
                        <th>Name</th>
                        <th>Time Logged</th>
                        <th>What you worked on (brief)</th>
                    </tr>
                </thread>
                <tbody>
                    <tr>
                        <th>11-2001</th>
                        <th>Mia</th>
                        <th>1.5</th>
                        <th>I worked on the website</th>
                    </tr>
                </tbody>
            </table>
        </div>
    );
};

export default App;
